// import logo from './logo.svg';
import "./home.scss";
import categories from "../../data/categories.json";
import Directory from "../../components/directory/directory";

import { Outlet } from "react-router-dom";

function Home() {
	return (
		<div className="App">
			<Outlet />
			<Outlet />
			<Directory categories={categories} />
		</div>
	);
}

export default Home;
